“On vous demande d’apporter des médicaments aux malades, c’est la moindre des choses pour La Croix ❌ Rouge.”
@isy.oselka , fils de deporté, hurle sa colère devant le domicile d’Alessandra Managon, patronne du @ICRC en Israël afin que les Otages puissent être visité et qu’ils puissent recevoir des soins, des médicaments. Le minimum pour une organisation qui se dit neutre et humanitaire. #Bringthemhomenow 
@awakeningisrael est à l’initiative de ce movement organique de citoyens israéliens qui s’élèvent contre l’inaction de la @croixrougefr
